import "../Sass/_avaliacoes.scss";
import { Container, Row, Col, Form } from 'react-bootstrap';
import React from 'react';
import Pagination from 'react-bootstrap/Pagination';

const Avaliacoes = () => {
    return (
        <>
            <Container className="cont2">

                <Row className="row">
                    <Col id="pg-prev">
                        <Pagination>
                            <Pagination.Prev href="/">Voltar</Pagination.Prev>
                        </Pagination>
                    </Col>
                </Row> <h2>Avaliação</h2>

                <Row className="row">
                    <Col>
                        <Form>
                            <h3>O que você escolheu hoje de principal?</h3>
                            {['radio'].map((type) => (
                                <div key={`inline-${type}`} className="mb-3">
                                    <Form.Check
                                        inline
                                        label="Carne"
                                        name="group1"
                                        type={type}
                                        id={`inline-${type}-1`}
                                    />
                                    <Form.Check
                                        inline
                                        label="Opção vegeteriana"
                                        name="group1"
                                        type={type}
                                        id={`inline-${type}-2`}
                                    />
                                    <Form.Check
                                        inline
                                        label="Nada"
                                        name="group1"
                                        type={type}
                                        id={`inline-${type}-3`}
                                    />

                                </div>
                            ))}
                        </Form>
                    </Col>
                </Row>

                <Row className="row">
                    <Col id="pg-next">
                        <Pagination>
                                
                            <Pagination.Next href="/avaliacoes/principal">Próximo</Pagination.Next>
                        </Pagination>
                    </Col>
                </Row>

            </Container>
        </>
    );
}

export default Avaliacoes;
